import React from "react";

function Home() {
  const handleLogout = () => {
    // Just redirect to login (no authentication tokens yet)
    window.location.href = "/";
  };

  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h1>Welcome to the E-Commerce App ðŸ›’</h1>
      <p>You are successfully logged in!</p>

      <button
        onClick={handleLogout}
        style={{
          marginTop: "20px",
          padding: "10px 20px",
          backgroundColor: "#ff4d4d",
          border: "none",
          borderRadius: "5px",
          color: "white",
          cursor: "pointer",
        }}
      >
        Logout
      </button>
    </div>
  );
}

export default Home;
